Set the DNS for the OAuth2 / Dex Server OAUTH2_DOMAIN="oauth2.example.com" cat > $HOME/fulcio-config/config.json <<EOF
{ "OIDCIssuers": { "https://accounts.google.com": { "IssuerURL": "https://accounts.google.com", "ClientID": "sigstore", "Type": "email" }, "https://${OAUTH2_DOMAIN}/auth": { "IssuerURL": "https://${OAUTH2_DOMAIN}/auth", "ClientID": "sigstore", "Type": "email" }, "https://token.actions.githubusercontent.com": { "IssuerURL": "https://token.actions.githubusercontent.com", "ClientID": "sigstore", "Type": "github-workflow" } }
}
EOF Inspect config.json and if everything looks in order, copy it into place mv config.json $HOME/fulcio-config/
